import Layout from "../components/Layout";
import LoginBack from "../components/backgrounds/LoginBack";

const Login = () => {
  return (
    <Layout>
      <LoginBack style={{ width: 100 }} />
      <h2>Login Page</h2>
    </Layout>
  );
};

export default Login;
